import React, { Component } from "react";

class Registro extends Component {
    render() {
        return (
            <div>
                <center>
                    <h1>Faça login para continuar</h1> <br />
                    <h3>Nome completo:</h3> <br />
                    <form>
                        <input type={'text'} /><br />
                        <h3>Email:</h3> <br />
                        <input type={'email'} /> <br />
                        <h3>Telefone:</h3>
                        <input type={'tel'} maxLength='11' /> <br/> <br/>
                        <button>Cadastrar</button>
                    </form>

                </center>
            </div>
        )
    }
}

export default Registro
